import React from "react";
import Landing from "./components/Landing";


function App() {

  return (
    <>
    <Landing/>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Landing />}>
          <Route path="about" element={<AboutUs />} />
          <Route path="contact" element={<Contact />} />
          <Route path="*" element={<Error/>} />
        </Route>
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
